weapon = []
status = []
seller = []
class Myparser(HTMLParser):
    def __init__(self):
        HTMLParser.__init__(self)
        self.flag = 0

    def handle_starttag(self, tag, attrs):
        def _attr(attrlist, attrname):
            for each in attrlist:
                if attrname == each[0]:
                    return each[1]

        if tag == 'div' and _attr(attrs, 'data-wtype'):
            datas = {}
            datas['武器'] = e2c[str(_attr(attrs, 'data-weapon'))]
            datas['紫卡名'] = _attr(attrs, 'data-weapon') + ' ' + _attr(attrs, 'data-name')
            datas['极性'] = _attr(attrs, 'data-polarity')
            datas['属性'] = '%s:%s | %s:%s | %s:%s | %s:-%s' % (
            _attr(attrs, 'data-stat1'), _attr(attrs, 'data-stat1val'), _attr(attrs, 'data-stat2'),
            _attr(attrs, 'data-stat2val'), _attr(attrs, 'data-stat3'), _attr(attrs, 'data-stat3val'),
            _attr(attrs, 'data-stat4'), _attr(attrs, 'data-stat4val'))
            datas['roll'] = _attr(attrs, 'data-rerolls')
            datas['price'] = _attr(attrs, 'data-price')
            weapon.append(datas)
        if tag == 'div' and _attr(attrs, 'title'):
            status.append(_attr(attrs, 'title'))
        if tag == 'div' and _attr(attrs, 'class') in ['attribute seller ','attribute seller patreon-badge']:
            self.flag = 1

    def handle_endtag(self, tag):
        if self.flag == 1:
            self.flag = 0

    def handle_data(self, data):
        data = data.strip()
        if self.flag and data:
            seller.append(data)

class Spider():
    def __init__(self,maxpage):
       self.url = 'http://riven.market/_modules/riven/showrivens.php?'
       self.maxpage = maxpage
       self.header  = {'content-type': 'application/jaon', 'user-agent': headers()}
    def get_the_data(self):
        for page in range(1,self.maxpage + 1 ):
              params = 'baseurl=aHR0cHM6Ly9yaXZlbi5tYXJrZXQv&platform=PC&limit=200&recency=-1&veiled=false&onlinefirst=true&polarity=all&rank=all&mastery=16&weapon=Any&stats=Any&neg=all&price=20000&rerolls=-1&sort=price&direction=ASC&page=%d&time=%d' %(page,int(1000*now))
              response = requests.get(self.url, params=params, headers=self.header,verify=False)
              html = response.text
              myparser = Myparser()
              myparser.feed(html)
